import React from "react";
import { useFormik } from "formik";
import * as Yup from "yup";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const SignupForm = () => {
  const navigate = useNavigate();

  const formik = useFormik({
    initialValues: {
      name: "",
      phone: "",
      companyName: "",
      email: "",
      employeeSize: "",
    },
    validationSchema: Yup.object({
      name: Yup.string().required("Name is required"),
      phone: Yup.string()
        .matches(/^[0-9]{10}$/, "Invalid phone number")
        .required("Phone is required"),
      companyName: Yup.string().required("Company name is required"),
      email: Yup.string().email("Invalid email").required("Email is required"),
      employeeSize: Yup.number().required("Employee size is required"),
    }),
    onSubmit: async (values) => {
      try {
        const response = await axios.post("/api/register", values);
        alert("Registration successful! Please verify your email and phone.");
        navigate("/verify-otp");
      } catch (error) {
        console.error("Registration failed:", error);
        alert("Registration failed. Please try again.");
      }
    },
  });

  return (
    <div style={styles.pageContainer}>
      {/* Left Text Section */}
      <div style={styles.textContainer}>
        <p>
          Lorem Ipsum is simply dummy text of the printing and typesetting
          industry. Lorem Ipsum has been the industry's standard dummy text ever
          since the 1500s, when an unknown printer took a galley.
        </p>
      </div>

      {/* Right Form Section */}
      <div style={styles.formContainer}>
        <div style={styles.contactLink}>
          <a href="#">Contact</a>
        </div>
        <form onSubmit={formik.handleSubmit} style={styles.form}>
          <h2>Sign Up</h2>

          <input
            type="text"
            name="name"
            placeholder="Name"
            onChange={formik.handleChange}
            value={formik.values.name}
            style={styles.input}
          />
          {formik.errors.name && (
            <div style={styles.error}>{formik.errors.name}</div>
          )}

          <input
            type="text"
            name="phone"
            placeholder="Phone no."
            onChange={formik.handleChange}
            value={formik.values.phone}
            style={styles.input}
          />
          {formik.errors.phone && (
            <div style={styles.error}>{formik.errors.phone}</div>
          )}

          <input
            type="text"
            name="companyName"
            placeholder="Company Name"
            onChange={formik.handleChange}
            value={formik.values.companyName}
            style={styles.input}
          />
          {formik.errors.companyName && (
            <div style={styles.error}>{formik.errors.companyName}</div>
          )}

          <input
            type="email"
            name="email"
            placeholder="Company Email"
            onChange={formik.handleChange}
            value={formik.values.email}
            style={styles.input}
          />
          {formik.errors.email && (
            <div style={styles.error}>{formik.errors.email}</div>
          )}

          <input
            type="number"
            name="employeeSize"
            placeholder="Employee Size"
            onChange={formik.handleChange}
            value={formik.values.employeeSize}
            style={styles.input}
          />
          {formik.errors.employeeSize && (
            <div style={styles.error}>{formik.errors.employeeSize}</div>
          )}

          <button type="submit" style={styles.button}>
            Proceed
          </button>
        </form>
      </div>
    </div>
  );
};

const styles = {
  pageContainer: {
    display: "flex",
    flexDirection: "row",
    height: "100vh",
    backgroundColor: "#f9f9f9",
  },
  textContainer: {
    flex: 1,
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    padding: "0 20px",
    textAlign: "left",
    fontSize: "16px",
    color: "#333",
  },
  formContainer: {
    flex: 1,
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
    backgroundColor: "#fff",
    padding: "20px",
    borderLeft: "1px solid #ccc",
  },
  contactLink: {
    alignSelf: "flex-end",
    marginBottom: "20px",
  },
  form: {
    width: "100%",
    maxWidth: "400px",
    display: "flex",
    flexDirection: "column",
    gap: "10px",
    padding: "20px",
    borderRadius: "8px",
    boxShadow: "0 0 10px rgba(0, 0, 0, 0.1)",
  },
  input: {
    padding: "10px",
    borderRadius: "4px",
    border: "1px solid #ccc",
    fontSize: "14px",
  },
  error: {
    color: "red",
    fontSize: "12px",
  },
  button: {
    padding: "10px",
    backgroundColor: "#007bff",
    color: "#fff",
    border: "none",
    borderRadius: "4px",
    cursor: "pointer",
  },
};

export default SignupForm;
